import { useState, useEffect } from 'react';
import { MapContainer, TileLayer, Marker, useMapEvents, useMap } from 'react-leaflet';
import MapCoordinatesContext from './mapctx';

    
function MapComponent() {
    const [coordinates, setCoordinates] = useState({ lat: 0, lng: 0 });

    useEffect(() => {
        // Fetch coordinates or set default values
        // Example: fetchCoordinates().then((data) => setCoordinates(data));
        setCoordinates({ lat: 50.9375, lng: 6.9603 });
    }, []);

    return (
        <MapContainer center={coordinates} zoom={13} style={{ height: '400px', width: '100%' }}>
            <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />
            <Marker position={coordinates} />
            {/* Add other map components or layers here */}
        </MapContainer>
    );
}

export default MapComponent;
